/**
 * Get product information by tagId
 * @param {string} tagId - The product tag ID
 * @returns {Object|null} Product info with title and icon, or null if not found
 */
export function getProductInfo(tagId) {
  return PRODUCT_MAPPING[tagId] || null;
}

/**
 * Get all product information
 * @returns {Array} Array of all product info objects
 */
export function getAllProducts() {
  return Object.values(PRODUCT_MAPPING);
}

/**
 * Filter and map product tags from session tags
 * @param {Array} tags - Session tags array
 * @param {boolean} excludeCreativeCloud - Whether to exclude Creative Cloud
 * @param {boolean} excludeNotProductSpecific - Whether to exclude "Not Product Specific"
 * @returns {Array} Array of product info objects with icon
 */
export function getProductsFromTags(tags = [], excludeCreativeCloud = true, excludeNotProductSpecific = true) {
  return tags
    .filter(tag => {
      if (!tag.tagId?.startsWith('caas:events/products')) return false;
      if (excludeCreativeCloud && tag.tagId.includes('creative-cloud')) return false;
      if (excludeNotProductSpecific && tag.tagId.includes('not-product-specific')) return false;
      return true;
    })
    .map(tag => getProductInfo(tag.tagId))
    .filter(Boolean); // Remove nulls for unmapped products
}

